// frontend/src/components/ForecastResult.js
import React from 'react';

function ForecastResult({ forecastData }) {
  if (!forecastData) {
    return (
      <div className="card mb-4">
        <div className="card-header bg-dark text-light">Forecast Overview</div>
        <div className="card-body">
          <p>No forecast data yet. Select a location and click Submit.</p>
        </div>
      </div>
    );
  }

  const { lat, lon, startDay, range, results, chosenDate } = forecastData;
  if (!results) {
    return (
      <div className="card mb-4">
        <div className="card-header bg-dark text-light">Forecast Overview</div>
        <div className="card-body">
          <p>No results returned from the backend.</p>
        </div>
      </div>
    );
  }

  // Example multi-day logic here
  // ...

  return (
    <div className="card mb-4">
      <div className="card-header bg-dark text-light">
        <h4 className="mb-0">Forecast Overview</h4>
      </div>
      <div className="card-body">
        <p><strong>Chosen Start Date:</strong> {chosenDate}</p>
        <p><strong>Coordinates:</strong> {lat?.toFixed(5)}, {lon?.toFixed(5)}</p>
        <p><strong>Day of Year Start:</strong> {startDay}</p>
        <p><strong>Range:</strong> {range} days</p>

        <div className="table-responsive mt-3">
          <table className="table table-dark table-bordered forecast-table">
            <thead>
              <tr>
                <th>Date</th>
                <th>Day of Year</th>
                {/* Insert parameter columns if present */}
              </tr>
            </thead>
            <tbody>
              {/* Loop over days */}
              {/* e.g. daysArray.map(...) */}
            </tbody>
          </table>
        </div>

        <div className="alert alert-secondary mt-3" role="alert">
          <h5>Weather Alerts</h5>
          <p>No active alerts</p>
        </div>
      </div>
    </div>
  );
}

export default ForecastResult;
